import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (

            <header>
<center></center>
<p style={{fontFamily: 'Helvetica Neue', fontSize:'20px'}}>

<pre style={{color:'#d9534f'}}> {`
████████╗ █████╗ ███████╗    █████╗ ██╗     ██╗
╚══██╔══╝██╔══██╗██╔════╝   ██╔══██╗██║     ██║
   ██║   ███████║███████╗   ███████║██║     ██║
   ██║   ██╔══██║╚════██║   ██╔══██║██║     ██║
   ██║   ██║  ██║███████║   ██║  ██║███████╗██║
   ╚═╝   ╚═╝  ╚═╝╚══════╝   ╚═╝  ╚═╝╚══════╝╚═╝
   `}
</pre>




</p>


<div class="menu" style={{borderWidth: '0.9px', borderSize: '3px', borderRadius: '5px', borderStyle:'dashed', backgroundColor:'##f5f5f5', borderColor: 'white', fontSize:'15px' }}>
    <ul> 
        <li style={{   display: 'inline', margin: '5px' }}><a href='/'style={{color:'white', fontFamily: 'Monospace', textDecoration: 'none'}}> <strong>Home</strong> </a></li>
        <li style={{   display: 'inline', margin: '5px' }}><a href='/archive'style={{color:'white', fontFamily: 'Monospace', textDecoration: 'none'}}> <strong>Archive</strong></a></li>
        <li style={{   display: 'inline', margin: '5px' }}><a href='/whoami'style={{color:'white', fontFamily: 'Monospace', textDecoration: 'none'}}> <strong>Whoami</strong></a></li>
    </ul>
</div>
<br />
<br />

</header>

        );
    }
}








export default Header;
